import React from 'react';
import styled from 'styled-components';

const ContactPageWrapper = styled.div`
  background-color: #333;
  padding: 50px;
`;

const ContactForm = styled.div`
  background-color: #444;
  padding: 30px;
  border-radius: 8px;
  box-shadow: 0px 4px 12px rgba(0, 0, 0, 0.3);
  margin-bottom: 30px;
`;

const Input = styled.input`
  background-color: #555;
  color: #fff;
  border: 1px solid #888;
  padding: 10px;
  width: 100%;
  margin-bottom: 20px;
  border-radius: 4px;

  &::placeholder {
    color: #aaa;
  }

  &:focus {
    border-color: #ccc;
    outline: none;
  }
`;

const TextArea = styled.textarea`
  background-color: #555;
  color: #fff;
  border: 1px solid #888;
  padding: 10px;
  width: 100%;
  height: 150px;
  margin-bottom: 20px;
  border-radius: 4px;

  &::placeholder {
    color: #aaa;
  }

  &:focus {
    border-color: #ccc;
    outline: none;
  }
`;

const SubmitButton = styled.button`
  background-color: #000;
  color: #fff;
  padding: 15px;
  border: none;
  width: 100%;
  border-radius: 4px;
  cursor: pointer;
  transition: background-color 0.3s ease;

  &:hover {
    background-color: #555;
  }
`;

const GetInTouchSection = styled.div`
  background-color: #222;
  padding: 30px;
  border-radius: 8px;
  color: #ccc;
`;

const ContactDetails = styled.div`
  background-color: #000;
  color: #fff;
  padding: 30px;
  border-radius: 8px;
`;

const ContactPage = () => {
  return (
    <ContactPageWrapper>
      <ContactForm>
        <h2>Contact Me</h2>
        <form>
          <Input type="text" placeholder="Enter your Name" />
          <Input type="email" placeholder="Enter a valid email address" />
          <TextArea placeholder="Enter your message" />
          <SubmitButton type="submit">Submit</SubmitButton>
        </form>
      </ContactForm>
      <GetInTouchSection>
        <h2>GET IN TOUCH</h2>
        <p>We are looking forward to starting a project with you!</p>
        <p>Contact information or additional details here.</p>
        {/* Add icons for social media if needed */}
      </GetInTouchSection>
      <ContactDetails>
        <h2>Call Us</h2>
        <p>1 (234) 567-891</p>
        <p>1 (234) 987-654</p>
        <h2>Location</h2>
        <p>121 Rock Street, 21 Avenue, New York, NY 92103-9000</p>
        <h2>Business Hours</h2>
        <p>Mon - Fri: 10 am - 8 pm</p>
        <p>Sat, Sun: Closed</p>
      </ContactDetails>
    </ContactPageWrapper>
  );
};

export default ContactPage;
